ERROR - 2015-09-13 08:22:05 --> Query error: Unknown column 'tovar_protiv' in 'field list' - Invalid query: INSERT INTO `tovar` (`tovar_name`, `tovar_prise`, `tovar_prise_ab`, `tovar_prise_b`, `tovar_prise_c`, `tovar_skidka`, `tovar_text`, `tovar_sostav`, `tovar_sposob`, `tovar_protiv`, `tovar_razmer`, `tovar_uther`, `tovar_dostupnost`, `tovar_sub_category_id`) VALUES (' НВ 1', '30795', '0', '0', '0', '0', 'наносорбент в водорастворимой гелевой форме\r\nКомплекс НВ 1 является эффективным регулятором водно-минерального баланса, способствует выведению из организма избытка жидкости и санации желудочно-кишечного тракта и мочевыделительной системы, повышает эффективность связывания и выведения из организма токсинов и вредных продуктов метаболизма. Обладает высокой сорбционной активностью благодаря входящим в его состав наночастицам диоксида кремния. Входящие в состав НВ 1 растворимые пищевые волокна (полисорбовит, гуммиарабик, фибрулин и натрия альгинат) оказывают выраженное репаративное действие на слизистую желудочно-кишечного тракта, поддерживают физиологический уровень пребиотических элементов питания в кишечнике, что нормализует работу желудочно-кишечного тракта во всех его отделах. Комплекс НВ1 обладает мочегонным, потогонным, желчегонным и гепатопротекторным действием, антимикробной и антитоксической активностью благодаря сочетанному влиянию экстрактов листьев березы, малины, брусники, цветков бессмертника, кассии, наличию почечного чая (ортосифона), а также силимарина.', 'гуммиарабик Инстантгам АВ, экстракт сены сухой (кассия остролистная), экстракт брусники, полисорбовит 95, натрия альгинат, экстракт листа малины сухой, экстракт ортосифона сухой, инулин «Фибрулин Инстант», сухой экстракт шрота плодов расторопши пятнистой, экстракт бессмертника сухой, экстракт листьев березы сухой, кремния диоксид. Вспомогательные вещества: вода, калия сорбат, натрия бензоат, вкусо-ароматическая основа «Грейпфрут».', 'способ применения', 'противапаказания', 'нет днных', 'другая инфа', 'На складе', '4')
